    if(!data)return "wait"
    const images = data[teamId]
    // console.log(images.payment_screenshot)
  return (
    <div className='admin_dashboard_images'>
        <h4>Id Card :</h4>
        <img className="image" src={images.team.id_card} alt="id_card"/>
        <h4>Payment Receipt</h4>
        <img  className = "image"src={images.team.payment_screenshot} alt="payment receipt"/>

    </div>
  )
}

export default Images
